import React, { Component } from 'react';
import '../../assets/css/home/homeRankingICC.css';

class RankingContentsIdentifire extends Component {

    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        const { contents } = this.props;
        console.log("Genereated Contents : ", contents)

        if (contents.data.odi.batsmen) {
            contents.data.odi.batsmen.map((item) => (
                console.log(item.player_name, item.player_display_picture)
            ));
        }


        return (
            <div className='card-columns'>
                <div className="card mb-1">
                    {contents.data.odi.all_rounder.map((rank_odi_AllRounder, i) => (
                        <div key={i}>

                            <div key={i} className='card p-2'>
                                <div className='card-title'>
                                    <img className='img' src={rank_odi_AllRounder.player_display_picture} alt='noImage' />
                                </div>

                                <div className='card-body'>
                                   {i+1} {" - "} {rank_odi_AllRounder.player_name} <br />
                                    {rank_odi_AllRounder.team_name}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>

                <div className="card">
                    {contents.data.odi.bowler.map((rank_odi_batsman, i) => (
                        <div key={i}>

                            <div key={i} className='card p-2'>
                                <div className='card-title'>
                                    <img className='img' src={rank_odi_batsman.player_display_picture} alt='noImage' />
                                </div>

                                <div className='card-title'>
                                    {rank_odi_batsman.player_name} <br />
                                    {rank_odi_batsman.team_name}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>


                <div className="card">
                    {contents.data.odi.batsmen.map((rank_odi_Bowler, i) => (
                        <div key={i}>

                            <div key={i} className='card  p-2'>
                                <div className='card-title'>
                                    <img className='img' src={rank_odi_Bowler.player_display_picture} alt='noImage' />
                                </div>

                                <div className='card-body'>
                                    {rank_odi_Bowler.player_name} <br />
                                    {rank_odi_Bowler.team_name}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>

            </div>

        );
    }
}


export default RankingContentsIdentifire;
